// src/data/performanceData.js

// You can get these numbers from your YOLOv8 training output (e.g., from results.csv)
export const metrics = {
  map50_95: 0.50, // mAP50-95 (mean Average Precision)
  map50: 0.68,    // mAP50 (mAP at IoU threshold of 0.5)
  precision: 0.69,
  recall: 0.70,
};

// Example data for a chart (e.g., Precision-Recall curve or loss over epochs)
export const chartData = [
  { epoch: 1, loss: 1.5, mAP: 0.3 },
  { epoch: 2, loss: 1.1, mAP: 0.45 },
  { epoch: 3, loss: 0.9, mAP: 0.6 },
  { epoch: 4, loss: 0.75, mAP: 0.72 },
  { epoch: 5, loss: 0.6, mAP: 0.78 },
];
